import React from 'react';
import Input from './../../components/Input/Input';
import './Main.css'
import Header from "../../components/Header";
import Pending from "../../components/Pending";
import DefaultBtn from "../../components/Wishlist/WishItem/ActionsBar/DefaultBtn";
import DeleteBtn from "../../components/Wishlist/WishItem/ActionsBar/DeleteBtn";

class Main extends React.Component{
    render(){
        return(
            <div className={"Main"}>
                <Header />
                <div className="content-container">
                    <div className="label">
                        <span style={{fontSize: 40+'pt'}}>Wishlist</span>
                        <span style={{fontSize: 1 + 'em'}} role="img" aria-label="smiling face with heart-eyes">&#128525;</span>
                    </div>
                    <div>
                        <Input />
                    </div>
                    <Pending/>
                    <DefaultBtn/>
                    <DeleteBtn/>
                </div>
            </div>
        )
    }
}

export default Main;
